import React from 'react'
import './Main.scss'

class Main extends React.Component {
    render() {
        return (
            <div className='Main'>
                <h1>Today</h1>
                <div>
                    <input type="checkbox" id="subscribeNews" />
                    <label for="subscribeNews">Subscribe to newsletter?</label>
                </div>
            </div>
        )
    }
}

export default Main
